import React from 'react'
import PropTypes from 'prop-types';

const Notification = ({ message }) => {
  if (message === null) {
    return null
  }

  return (
    <div className="notification">
      {message}
    </div>
  )
}

Notification.propTypes = {
  notification: PropTypes.string
};

export default Notification
